Gràcies a #Junts, gràcies a tota la gent que està al darrera, els que estan a fora, als que estan a dins. Els que estan a l'ombra i els que donem la cara.
Ens heu tornat la llum al final del túnel.

@LauraBorras  "Hem pensat sempre en termes de país i malgrat desencontres i tot plegat, continuem endavant.
